import React, {Component} from 'react';
import './contact.css'


/* Importing library for DOM elements animations */
import Fade from 'react-reveal/Fade';
import Flip from 'react-reveal/Flip';
import Rotate from 'react-reveal/Rotate';
import Bounce from 'react-reveal/Bounce';
import Roll from 'react-reveal/Roll';
import Zoom from 'react-reveal/Zoom';
import Slide from 'react-reveal/Slide';
import RubberBand from 'react-reveal/RubberBand';
import Spin from 'react-reveal/Spin';



export default class contact extends Component {
    render() {

      return (
        <div className="component-contact">
          <div className="container">

            <Bounce>
              <div className="row">

                <div className="spacer col-md-4"></div>
                <header className="col-md-4 contact-header">
                  <h1 className="font-weight-600"> CONTACT </h1>
                </header>
                <div className="spacer col-md-4"></div>

                <div className="spacer col-md-5"></div>
                <div className="border col-md-2"></div>
                <div className="spacer col-md-5"></div>

              </div>
            </Bounce>

            <main className="row">

              {/* Serverless submit, done with */}
              <form className="col-md-12" action="https://formsubmit.co/your@email.com" method="POST">
                <header>

                  <Roll>
                    <h3 className="font-weight-600 form-header"> Write a message to me: </h3>
                  </Roll>

                  <Zoom>
                      <input
                        type="email"
                        className="input col-md-7"
                        placeholder="Your email"
                      />

                      <textarea
                        cols="50"
                        rows="6"
                        className="input text col-md-7"
                        placeholder="Your message"
                      ></textarea>
                  </Zoom>

                </header>
              </form>

              <Bounce>
                <h3 className="font-weight-600 col-md-12 email-header"> Or send an email: <span className="email">janpaweldrugi@gmd.com </span> </h3>
              </Bounce>

            </main>

          </div>
        </div>
      );

    }
  }
